import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App container-fluid">
      <Row>
        <Col className="p-5 heightFull align-items-center" md={5}>
          <h1 className="font-weight-bold m-0">Chazzy</h1>
          <p className="text-secondary">A time messaging app.</p>
          <form className="my-5">
            <input className="form-control shadow-input my-2" placeholder="@username" type="text" />
            <input className="form-control shadow-input my-2" placeholder="password" type="password" />
            <button className="btn btn-secondary shadow-input my-2" type="submit">Sign In</button>
          </form>
        </Col>
        <Col className="p-5 heightFull align-items-center" md={7}>
          {/* <h4>Chazzy</h4> */}
        </Col>
      </Row>
    </div>
  );
}

export default App;
